import './style.css';

import cards from './../../img/icons/cards.png';
import google from './../../img/icons/google-play.png';
import appstore from './../../img/icons/app-store.png';

const Footer = () => {
  return (
    <footer className="footer">
      <div className="footer_logo">BookStore</div>

      <div className="footer-content">
        <ul className="footer-column">
          <li><span>To customers</span></li>
          <li>Order tracking</li>
          <li>Shipping</li>
          <li>Payment</li>
          <li>Contacts</li>
          <li>Return of the product</li>
          <li>FAQ</li>
          <img src={cards} alt="Payment" className="cards-image" />
        </ul>

        <ul className="footer-column">
          <li><span>Services</span></li>
          <li>Gift certificates</li>
          <li>Bonus cards</li>
        </ul>

        <ul className="footer-column">
          <li><span>Company</span></li>
          <li>About us</li>
          <li>Our impact</li>
          <li>Future</li>
        </ul>

        <div className="footer-column">
          <span>Follow us</span>
          <div className="footer-icons">
            <FaFacebookF />
            <FaInstagram />
            <FaTwitter />
          </div>

          <p className="footer-apps-title">Download free apps for iOS and Android.</p>
          <img src={google} alt="Google Play" className="app-badge" />
          <img src={appstore} alt="App Store" className="app-badge" />
        </div>
      </div>
    </footer>
  );
};

export default Footer;


